    @Test
    public void testParser2() throws Exception {

        GetStationBoardResult.GetStationBoardResultSimple result = GetStationBoardResultParser.newInstance(SOAP);

        System.out.println(result.generatedAt);
        System.out.println(result.crs);
        System.out.println(result.filtercrs);
        System.out.println(result.filterLocationName);
        System.out.println(result.locationName);
        System.out.println(result.platformAvailable);

        for (String nrccMessage : result.nrccMessages) {
            System.out.println(nrccMessage);
        }
        System.out.println(result.nrccMessages.size());

        for (GetStationBoardResult.Service trainService : result.trainServices) {
            //System.out.println(trainService.serviceID);

            StringBuilder sb = new StringBuilder();

            sb.append("From: ")
                    .append(trainService.origin.location.locationName)
                    .append(" To: ")
                    .append(trainService.destination.location.locationName)
                    .append(" . Calling at: ");

            for (GetStationBoardResult.Location location : trainService.subsequentCallingPoints.callingPointList) {
                sb.append(location.locationName)
                        .append(", ");
            }

            sb.append(". at ")
                    .append(trainService.standardDeparture)
                    .append(" is ")
                    .append(trainService.estimatedDeparture);

            System.out.println(sb.toString());
        }
    }
